async function createNewCommentForReports(actor, entity, reported, settings) {
    const targetNumber = entity.type === "comment" ? entity.parentNumber : entity.number;
    core.info(`Target number for comment creation: ${targetNumber.toString()}`);
    return await actor.createComment(createCommentBody(entity, reported, settings));
}

